    [],nt"revision_timestamp": "2013-03-15T21:15:09.598766",nt"name": "original-vector-datasets-for-hawaii-streamstats",nt"isopen":
    false,nt"url": null,nt"notes": "These datasets each consist of a folder
    containing a personal geodatabase of the NHD, and shapefiles used in the HydroDEM
    process. These files are provided as a means to document exactly which lines were
    used to develop the HydroDEMs. Each folder contains a line shapefile named for the
    8-digit HUC code, containing the NHD flowlines that comprise the coastline for that
    island. The u00e2u0080u009chydrolines.shpu00e2u0080u009d shapefile contains the
    lines that were burned into the DEM. These lines were selected from the NHD flowlines,
    with some minor editing in places. The u00e2u0080u009cwbpolys.shpu00e2u0080u009d
    shapefile contains the water-body polygons that were selected from the NHD and used
    in the bathymetric gradient process. The folders for HUCs 20010000 (Hawaii) and
    20020000 (Maui) also contain a u00e2u0080u009cwalls.shpu00e2u0080u009d shapefile,
    which contains the lines that were superimposed on the surface as u00e2u0080u009cwalls.u00e2u0080u009d",nt"license_title":
